import React, { useEffect } from "react";
import Aos from "aos";
import "aos/dist/aos.css";
import { Container, Row, Col } from "react-bootstrap";

function Contact() {

  useEffect(() => {
   Aos.init({duration: 2000});
  }, []);

  return (
    <Container fluid className="contact-me-section" data-aos="fade-down">
      <Container>
        <Row>
          <fieldset className="form-grid">
                        <legend>Contact me</legend>

                        <div className="form-group">
                            <label htmlhtmlFor="first-name">First name</label>
                            <input type="text" name="first-name" id="first-name" placeholder="Your name" />
                        </div>

                        <div className="form-group">
                            <label htmlFor="last-name">last name</label>
                            <input type="text" name="last-name" id="last-name" placeholder="Your last name" />
                        </div>

                        <div className="form-group">
                            <label htmlFor="email">E-mail</label>
                            <input type="email" name="email" id="email" placeholder="Your e-mail" />
                        </div>

                        <div className="form-group full-width">
                            <label htmlFor="message">Message</label>
                            <textarea name="message" id="message" cols="30" rows="10" placeholder="Your message"></textarea>
                        </div>

                        <div className="form-group full-width">
                            <button type="submit">Send message</button>
                        </div>
                    </fieldset>
        </Row>
      </Container>
    </Container>
  );
}
export default Contact;
